import React from 'react';
import styled from '@emotion/styled';

const Title = styled.div`
  color: black;
  border-bottom: 2px;
  border-color: black;
`;
const FlavorText = styled.div`
  position: absolute;
  right: 4%;
  top: 5%;
  font-style: italisized
  color: grey;
`;

function App() {
  return (
    <div>
      <Title>Bear Lake Honey</Title>
      <FlavorText>Bee Happy</FlavorText>
    </div>
  );
}

export default App;
